    mpld3.register_plugin("rotatetick", RotateTick);
    RotateTick.prototype = Object.create(mpld3.Plugin.prototype);

    //the plugin expects to be passed a property named "id", which in this case is plot div id.

    RotateTick.prototype.requiredProps = ["axid", "tick_labels", "rotation", "total", "ncolumn"];

    function RotateTick(fig, props){
        mpld3.Plugin.call(this, fig, props);
    };
    
    RotateTick.prototype.draw = function(){

        // make the labels rotate 90 degrees
        var axid = this.props.axid;
        var cls = '.mpld3-xaxis';
        if(axid==1) cls = '.mpld3-yaxis';

        var labels = this.props.tick_labels;
        var rotation = this.props.rotation;
        console.log(labels, rotation);


        len = this.fig.axes.length;
        total = this.props.total;
        ncol = this.props.ncolumn;
        //console.log(len, ncol);

        for(var i=1; i<=ncol; i++){

        var ax = this.fig.axes[total-i];

        textanchor = "middle";
        dx="0";
        dy=".8em";
        if(rotation !=0) {
          dx = "-.8em"
          dy = "-.15em"
          textanchor="end"
        }
        ax.baseaxes.selectAll(cls + ' .tick text').data(labels)
            .style("text-anchor", textanchor)
            .text(function(d,i){return d;})
            .attr("dx", dx)
            .attr("dy", dy)
            .attr("transform", function(d) {
                return "rotate("+rotation+")" 
                });
